import csvclass Evaluation:        def __init__(self, system, model):                self.system = system                self.model = model        self.results = model.results                self.printModelInstance()        self.printResults()        def printModelInstance(self):                fileName = self.system['folderOutput'] + 'model_instance.txt'         with open(fileName, 'w') as f:            f.write("My description of the instance!\n")            self.model.instance.display(ostream=f)            f.close()                def printResults(self):                fileName = self.system['folderOutput'] + 'results.txt'         with open(fileName, 'w') as f:            f.write("Results\n")            # self.model.results.write()            self.model.results.pprint()            f.close()                       